import styled from "styled-components";


export const Style = styled.div `{

	width: 100%;
	height: 55%;
	border: 20px;
	box-shadow: 10px 8px 20px 5px rgb(0 0 0 / 50%);

	background-color: #8CF3F3;
	width: 100%;
	height: 55%;
    margin 0 auto;
    display: flex;
    flex-direction: row;



	}
`;
